import { Sidebar } from '../components/Sidebar'
import { Card } from '../components/Card'
import filter from '../assets/filter.svg'

export const Home = () => {
    const cards = [
        {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abb", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        },
    ]

    return (
        <div className="bg-[#E1E1E1] flex min-h-screen max-w-screen w-full h-full">
            <Sidebar />

            <div className=" w-4/5 flex flex-col space-y-4 ml-8 mr-8 mt-4">
                <div class="flex items-center p-2">
                    
                    <input class="rounded-l-md px-4 py-2 w-full text-gray-700 leading-tight" id="search" type="text" placeholder="Search for Projects..."/>
                    <button class="bg-white py-2 px-"><img src={filter}></img></button>
                    <button class="bg-purple-500 text-white font-bold py-5 px-9 rounded-r-md"></button>
                </div>



                <p className='text-[#4A92FF] mb-2 pt-6 font-bold text-lg'>Trending Projects</p>
                    {cards.map(item => {
                        return (
                            <Card title={item.title} desc={item.desc} 
                            />
                        
                    )
                })}
            </div>
        </div>
    )
}
